lockfileVersion: '6.0'

settings:
  autoInstallPeers: true
  excludeLinksFromLockfile: false

importers:

  .:
    dependencies:
      lodash:
        specifier: ^4.17.21
        version: 4.17.21
      express:
        specifier: ~4.18.2
        version: 4.18.3
      axios:
        specifier: '>=1.0.0'
        version: 1.6.8
    devDependencies:
      typescript:
        specifier: ^5.0.0
        version: 5.4.5
      prettier:
        specifier: ^3.0.0
        version: 3.2.5

packages:

  /axios@1.6.8:
    resolution: {integrity: sha512-test}
    engines: {node: '>=14'}
    dev: false

  /express@4.18.3:
    resolution: {integrity: sha512-test}
    dev: false

  /lodash@4.17.21:
    resolution: {integrity: sha512-test}
    dev: false

  /prettier@3.2.5:
    resolution: {integrity: sha512-test}
    dev: true

  /typescript@5.4.5:
    resolution: {integrity: sha512-test}
    dev: true
